import React from "react";
import propTypes from 'prop-types'
import './navigation-item.css'

const NavItem=(props)=>{
      let mas=[]
      for(let i=0;i<18;i++){
          mas.push(i)
      }

        return(
             <div className="navItem">
                 <div>
                     <img 
                      src={props.icon} 
                      alt="icon"
                      /> <br/>
                  {mas[props.icon]} {props.label} </div>
                 <div>{'>'}</div>
             </div>
            )
}
NavItem.propTypes={
    icon:propTypes.string
}
NavItem.defaultProps={
    icon:'./Icon/0.png'
}
export default NavItem
